function transformDates(obj) {
    if (!obj || typeof obj !== 'object') return undefined;

    const objWithDates = JSON.parse(JSON.stringify(obj));

    if (objWithDates.createdAt) {objWithDates.createdAt = iml.parseDate(objWithDates.createdAt);}

    return objWithDates;
}

transformDates.test:
it('should not throw any kind of error on valid input', () => {
    const result = transformDates({ createdAt: new Date() });
    assert.equal(result.createdAt instanceof Date, true);
  });

  it('should not return errors on empty, null, or undefined values', () => {
    assert.strictEqual(transformDates(), undefined);
    assert.strictEqual(transformDates(''), undefined);
    assert.strictEqual(transformDates(null), undefined);
    assert.strictEqual(transformDates(undefined), undefined);
  });

  it('should not return errors if input is not an object', () => {
    assert.strictEqual(transformDates('this is definitely not an object'), undefined);
  });

  it('should just return the object in case of no \'createdAt\' field', () => {
    const input = { name: 'Vlad', surname: 'Bezdushnyi', date: '2024-01-31T12:00:50Z'};
    const result = transformDates(input);
    assert.deepStrictEqual(result, input);
  });

