function formatFileUploadRequest(inputParams, requestFields) {
    if (!requestFields) throw new Error('Request fields for the file upload do not exist.');
    if (!inputParams) throw new Error('Input fields for the file upload do not exist.');

    if (typeof inputParams !== 'object') throw new Error('Input data is not an object.');

    const fields = JSON.parse(requestFields);
    fileObj = {
        value: inputParams.fileData,
		options: {
        	filename: inputParams.fileName
		}
    };
    fields.file = fileObj;

    return fields;
}

